import React, { useState } from 'react';
import { Menu } from 'antd';
import { GithubOutlined, LinkedinFilled } from '@ant-design/icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin } from '@fortawesome/free-brands-svg-icons';

const labels = ['Home', 'About Me', 'Skills', 'Projects', 'Blog', 'Contact'];
const items = labels.map((label, index) => ({
  key: index + 1,
  label: `${label}`,
}));

const socialLinks = {
  github: 'https://github.com/zehragizem',
  linkedin: "https://www.linkedin.com/in/zehra-gizem-duman-344952237/",
};

const AppHeader = () => {
  const [clickedIcon, setClickedIcon] = useState(null);

  const handleSocialClick = (link, icon) => {
    window.open(link, '_blank'); // Yeni bir sekmede bağlantıyı aç
    setClickedIcon(icon);
  };

  const socialIcons = {
    github: (
      <GithubOutlined
        style={{
          fontSize: '18px',
          padding: '8px',
          backgroundColor: clickedIcon === 'github' ? '#333' : '#000',
          color: '#fff',
          borderRadius: '50%',
          transition: 'background-color 0.3s',
        }}
      />
    ),
    linkedin: (
      <LinkedinFilled
        style={{
          fontSize: '18px',
          padding: '8px',
          backgroundColor: clickedIcon === 'linkedin' ? '#005582' : '#0077B5',
          color: '#fff',
          borderRadius: '50%',
          transition: 'background-color 0.3s',
        }}
      />
    ),
  };

  return (
    <div className='container-fluid'>
      <div className='header'>
        <div className='logo' />
        <Menu
          mode='horizontal'
          defaultSelectedKeys={['1']}
          style={{
            display: 'flex',
            justifyContent: 'flex-end',
            flex: 1,
            minWidth: 0,
          }}
        >
          {items.map((item) => (
            <Menu.Item key={item.key}>{item.label}</Menu.Item>
          ))}
        </Menu>
        <div style={{ display: 'flex' }}>
          {Object.keys(socialLinks).map((key) => (
            <div
              key={key}
              style={{ borderRadius: '50%', overflow: 'hidden', margin: '0 8px', cursor: 'pointer' }}
              onClick={() => handleSocialClick(socialLinks[key], key)}
            >
              {socialIcons[key]}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AppHeader;
